import React from 'react'

const BotArmy = ({card,onCardClose}) => {

  const handleclose =() => {
    onCardClose(card);
  }
  return (
    <div>
      <h2>Your Bot Army</h2>
      {card.length === 0 ? (
        <p>Your bot army is empty.</p>
      ) : (
        card.map((bot) => (
          <div key={bot.id}>
            <img
              src={bot.avatar_url}
              alt={bot.name}
              className="card-img-top"
              style={{ backgroundColor: "grey", }}
            />
            <div className="card-body">
              <h2 className="card-name" style={{ marginLeft: "70px" }}>
                {bot.name}
              </h2>
              {/* Add other bot details here */}
              <button type="button" className="btn btn-danger" onClick={() => handleclose(card)}>
                Close
              </button>
            </div>
          </div>
        ))
      )}
    </div>
  );
};

export default BotArmy;
